const MessageContainer = ({message}) =>{
    return <div>
    {
        message.map((message, index)=>
        <table striped bordered>
            <tr key={index}>
                <td> {message} : {message.username}</td>
            </tr>
        </table>)
    }
    </div>
}
export default MessageContainer;
